import React from 'react';

const cloud_webpage = () => {
  return (
    <div className="container mt-5">
      <h1>Hello, Bootstrap!</h1>
      <p>This is a simple React webpage using Bootstrap.</p>
      <button className="btn btn-primary">Click Me</button>
    </div>
  );
};

export default cloud_webpage;
